import React from 'react'
import { css, jsx } from '@emotion/react'
console.log("side");

const Slide = (props) => {
  console.log(props)
  return(
  <>
  <h1>HI</h1>
  <div
    css={css`
    height: 100;
    width: 100%;
    background-image: url('${props}');
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
  `}
  />
  </>
  )
  }

export default Slide
